import React from 'react';

class WorkGrid extends React.Component {
	render() {
		const { slideState } = this.props;
		let WorkItem = slideState.firstSlide.map((work, i) => (
			<div className="image-div">
				<img src={work} alt="" />
			</div>
		));
		return <>{WorkItem}</>;
	}
}

export default WorkGrid;
